import './App.css';  

import { useState } from 'react'

import NavBar from './components/NavBar/NavBar' 
import Events from './components/Events/Events' 
import DummyDate from './components/Data/DummyData'


function App() { 

 const [Date, setDate] = useState(DummyDate)

  return (
    <div className="App">
      <NavBar/> 
      <Events data={Date}/>
    </div>

  );
}

export default App;
